import React from "react";
import { connect } from "react-redux";
import { setDifficultyLevel } from "../actions";
import { DifficultyButton } from "../components/DifficultyButton";
const StartPage = (props) => {
  console.log(props);
  return (
    <div className="page">
      <div className="difficulty-title">Difficulty</div>
      <div className="pick-difficulty">
        <p className="difficulty"></p>
        <DifficultyButton level={"easy"} name={"Easy"} />

        <button className="button-difficulty start-button">Start Game</button>
      </div>
    </div>
  );
};

const mapStateToProps = (state) => {
  return state;
};

export default connect(mapStateToProps, {
  setDifficultyLevel,
})(StartPage);
